    false,nt"url": null,nt"notes": "This narrative report for Devils Lake Wetland
    Management District outlines District accomplishments for the fiscal year of 1975.
    The report begins by giving a brief description of the District. Wildlife- including
    migratory birds, upland game birds, big game animals, fur animals, predators, rodents,
    raptors, fish, and disease- is also covered. The District development and maintenance
    section discusses physical developments, plantings, and vegetation control. Resource
    management is outlined; topics include  haying and fur harvesting. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, District visitors, District participation,
    hunting, violations, safety, and revenue sharing. N-R forms and photographs are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
